function readData(jsonData)
{
  var ret;
  for(let data in jsonData)
  {
    if(typeof(data)=="object" || typeof(data)=="array")
      ret+=readData(data);
    else
      ret+=jsonData[data];
    document.write(data+": "+ret);
  }
  return ret;
}
export default readData;
